watch: {
  borrow: {
    immediate: true,
    handler(val) {
      if (val) {
        // 自动根据归还日期设置状态
        this.form = { ...val };
        if (typeof this.form.status === "string") {
          // 兼容旧数据
          this.form.status = this.form.status === "已归还" ? 1 : 0;
        }
        if (!("status" in val)) {
          this.form.status = val.returnDate ? 1 : 0;
        }
      } else {
        this.form = {
          userId: "",
          userName: "",
          bookId: "",
          bookName: "",
          borrowDate: "",
          returnDate: "",
          status: 0,
        };
      }
    },
  },
},
mounted() {
  // 加载所有图书
  this.fetchBooks();
  this.fetchUsers(); // 新增
